import React from "react";
// Import Component MUI
import {
  Box,
  Container,
  Grid,
  Typography,
  // Button,
  // IconButton,,
} from "@mui/material";

// Import Icon
import ChevronLeftRoundedIcon from "@mui/icons-material/ChevronLeftRounded";

export default function ListSeritifikat() {
  return (
    <div>
      <Box>
        <Container>
          <Grid container spacing={2}>
            <Grid item xs={2}>
              <IconButton>
                <ChevronLeftRoundedIcon />
              </IconButton>
            </Grid>
            <Grid item xs={10}>
              <Typography>Sertifikat</Typography>
            </Grid>
          </Grid>
        </Container>
      </Box>
    </div>
  );
}
